def reverseComplement(strand):
    revstrand = str()
    for i in strand[::-1]:
        if (i == "A"):
            revstrand += "T"
        elif (i == "C"):
            revstrand += "G"
        elif (i == "G"):
            revstrand += "C"
        else:
            revstrand += "A"
    return revstrand

